function Config(e){this.container=e.container?e.container:"paginastic_container";this.current_page=e.current_page?e.current_page:"paginastic_current_page";this.class_active_page=e.class_active_page?e.class_active_page:"active_page";this.show_per_page_id=e.show_per_page_id?e.show_per_page_id:"paginastic_show_per_page";this.show_per_page=e.show_per_page?e.show_per_page:10;this.page_navigation=e.page_navigation?e.page_navigation:"paginastic_navigation"}var Paginastic={};Paginastic.Pagination=new function(){this.init=function(e){if(e!=="undefined"&&Object.keys(e).length===6){Paginastic.Configuration=new Config(e)}var t=e.show_per_page;var n=$("#"+e.container+"").children().size();var r=Math.ceil(n/t);$("#"+e.current_page+"").val(0);$("#"+e.show_per_page_id+"").val(t);var i='<a class="previous_page" href="javascript:Paginastic.Pagination.previousPage();">Prev</a>';var s=0;while(r>s){i+='				<a class="page" href="javascript: Paginastic.Pagination.goToPage('+s+')" data-page="'+s+'">					'+(s+1)+"				</a>";s++}i+='<a class="next_page" href="javascript: Paginastic.Pagination.nextPage();">Next</a>';$("#"+e.page_navigation+"").html(i);$("#"+e.page_navigation+" .page:first").addClass("active_page");$("#"+e.page_navigation+" .page:first").addClass("first_page");$("#"+e.page_navigation+" .page:last").addClass("last_page");$("#"+e.container+"").children().css("display","none");$("#"+e.container+"").children().slice(0,t).css("display","block");Paginastic.Pagination.isFirstPage()};this.previousPage=function(){var e=parseInt($("#"+Paginastic.Configuration.current_page+"").val())-1;if($(".active_page").prev(".page").length==true){Paginastic.Pagination.goToPage(e)}Paginastic.Pagination.isLastPage();Paginastic.Pagination.isFirstPage()};this.nextPage=function(){var e=parseInt($("#"+Paginastic.Configuration.current_page+"").val())+1;if($(".active_page").next(".page").length==true){Paginastic.Pagination.goToPage(e)}Paginastic.Pagination.isLastPage();Paginastic.Pagination.isFirstPage()};this.goToPage=function(e){var t=parseInt($("#"+Paginastic.Configuration.show_per_page_id+"").val());var n=e*t;var r=n+t;$("#"+Paginastic.Configuration.container+"").children().css("display","none").slice(n,r).css("display","block");$(".page[data-page="+e+"]").addClass("active_page").siblings(".active_page").removeClass("active_page");$("#"+Paginastic.Configuration.current_page+"").val(e);Paginastic.Pagination.isLastPage();Paginastic.Pagination.isFirstPage()};this.isFirstPage=function(){if($(".first_page").hasClass("active_page")){$(".previous_page").hide()}else{$(".previous_page").show()}};this.isLastPage=function(){if($(".last_page").hasClass("active_page")){$(".next_page").hide()}else{$(".next_page").show()}}}